!function(){document.addEventListener("mousemove",(function(a){t.forEach(t=>{const e=t.getAttribute("data-parallax"),n=(window.innerWidth-a.pageX*e)/100,o=(window.innerWidth-a.pageY*e)/100;t.style.transform=`translateX(${n}px) translateY(${o}px)`})}));const t=document.querySelectorAll("[data-parallax]")}();